style.css:
@-moz-document url-prefix("https://student.upi.edu") {
.br-header {
  	  height: 60px;
  	  position: fixed;
  	  top: 0;
  	  right: 0;
  	  left: 0;
  	  z-index: 1030;
  	  background-color: #1D2939;
  	  box-shadow: 0 1px 4px 0px rgba(0, 0, 0, 0.16);
  	  display: flex;
  	  align-items: center;
  	  justify-content: space-between;
    transition: all 0.2s ease-in-out;
	}
}
